Details & description:
David Burns is a solicitor and practices in the areas of commercial and corporate law, real estate, wills and personal planning documents, estate planning and administration.
David’s practice experience includes drafting complex legislation, decision reports, and documents for multi-billion dollar industrial projects as well as advising participants on legal processes and drafting related agreements.  He assists clients with:
•	Estate and personal planning;
•	Drafting and negotiating commercial leases and contracts;
•	Advising and preparing real estate purchase and sale agreements and leases;
•	Advising and drafting documents for executors and trustees administering estates; and
•	Business asset/share purchases, shareholder agreements, and incorporations.

RLR Lawyers (Ramsay Lampman Rhodes) is one of Vancouver Island’s largest full-service law firms. Our lawyers are recognized as leading practitioners in their respective fields. From routine matters to complex commercial transactions and personal injury claims, we offer trusted legal advice and representation to Island businesses and residents. For over 40 years our lawyers have worked to advance the interests of clients across Vancouver Island including the Comox and Alberni Valleys.

Legal excellence, business savvy and a practical outlook define our approach to client service.
